import React from 'react';
import './App.css';
import FooterComponent from './components/FooterComponent';
import HeaderComponent from './components/HeaderComponent';
import ListCustomerComponent from './components/ListCustomerComponent';
import { Route, Switch}from 'react-router-dom'
import CreateCustomerComponent from './components/CreateCustomerComponent';
import UpdateCustomerComponent from './components/UpdateCustomerComponent';
function App() {
  return (
    <div> 

          < HeaderComponent/>
            <div className="container">
              <Switch>
                <Route path="/" component={<ListCustomerComponent/>}/>
                <Route path="/customers" element={<ListCustomerComponent/>}/> 
                <Route path="/add-customer" element={<CreateCustomerComponent/>}/>
                <Route path="/update-customer/:id" element={<UpdateCustomerComponent/>}/>
              </Switch>
            </div>
          <FooterComponent/>

    </div>
  );
}

export default App;
